setProps(props)

Принимает:

{Object} props


Использование:


Устанавливает входные параметры Wrapper vm и выполняет принудительное обновление.
Обратите внимание, что Wrapper должен содержать экземпляр Vue.
import { mount } from 'vue-test-utils'
